fun CountrySelector(country: Country, onSelection: (Country) -> Unit, pickerRowContent: (Country) -> Unit = { defaultCountry ->
        Row(
            verticalAlignment = Alignment.CenterVertically,
            horizontalArrangement = Arrangement.spacedBy(8.dp)
        ) {
            Image(
                painter = painterResource(resource = defaultCountry.flagImageResource),
                contentDescription = defaultCountry.countryName,
                modifier = Modifier
                    .size(24.dp)
                    .clip(CircleShape)
            )
            Text(defaultCountry.internationalDialCode)
        }
    }, searchBarContent: (searchQuery: String, onQueryChange: (String) -> Unit, hasError: Boolean) -> Unit = { searchQuery, onQueryChange, hasError ->
        TextField(
            value = searchQuery,
            onValueChange = onQueryChange,
            singleLine = true,
            modifier = Modifier.fillMaxWidth(),
            label = { Text("Search") },
            leadingIcon = {
                Icon(
                    imageVector = Icons.Default.Search,
                    contentDescription = "Search countries"
                )
            },
            isError = hasError,
            placeholder = { Text("Enter country name or code") }
        )
    })

